import React from "react";
import "./Profile.css";

function Profile(props)
{
    return(
        <div className = "Profile">
            <h3>DesignSphere</h3>
            <div className = "ProfileCard">
                <img src = "https://helpx.adobe.com/photoshop/using/convert-color-image-black-white.html" alt = "Cover-Image"></img>
                <span>Name</span>
                <span>@Username</span>
                <span>Description</span>
                <button>View Full Profile</button>
            </div>
        </div>
    );
}

export default Profile;
